import React, { useState } from "react";
import ChildOne from "../folderone/ChildOne";

const Test = () => {
  const [data, setData] = useState("");

  const handleChange = (value) => {
    console.log("Value received from child:", value);
    setData(value); // Update state with the value from the child
  };

  return (
    <div>
      <p>Test Folder</p>
      <p>{data}</p> {/* Display the data received from the child */}
      <ChildOne handleChange={handleChange} /> {/* Pass the function as a prop */}
    </div>
  );
};

export default Test;
